import { FaLaughBeam } from 'react-icons/fa';
import { FaSmile } from 'react-icons/fa';
import { FaGrinBeamSweat } from 'react-icons/fa';

import { IconContext } from "react-icons";

//IconContext.Providerのカラーが効かない！！11月7日

const GameArea = () => {

    let name = "mario";

    const handleClick = (e) => {
        name = "luigi";
        console.log("Hello ninjas", e);
    }

    const handleClickWithArg = (name, e) => {
        console.log("hello " + name, e.target);
    }

    return (
        <div className="gamearea" style={{ fontSize: "30px"}}>GameArea
            <div className="figure" style={{
                fontSize: "30px",
                marginBottom: "10px"
            }}>Figure Area!
                <IconContext.Provider value={{ color: "#ff6b6b", size: "50px", backgroundColor: "red" }}>
                    <div>
                        <FaLaughBeam />
                        <FaSmile />
                        <FaGrinBeamSweat />
                    </div>
                </IconContext.Provider>
                <p>{name}</p>
            </div>
            <div className="text">
                <form>
                    <label>
                        Text Area:
                        <input type="text" name="name" />
                    </label>
                    <input type="submit" value="Submit" />
                </form>
                <button onClick={handleClick}>Click me</button>
                <button onClick={(e) => handleClickWithArg("mario", e)}>Click me again</button>

            </div>
        </div>
    );
}

export default GameArea;
